import { useEffect, useState } from "react";

const Tile = (props) => {

    const { pic, name } = props;

    const [clicked, setClicked] = useState(false);

    const handleClickEvent = () => {
        if (clicked) {
            setClicked(false);
        } else {
            setClicked(true);
        }
    }

    return ( 
        <div className={clicked ? "tile-clicked" : "tile"} onClick={handleClickEvent}>
            <img src={clicked ? null : pic} className="tile-image" alt={name}/>
            <div className="tile-content">{name}</div>
        </div>
     );
}

export default Tile;
